(6, '0', '0', 'asmitapatil0102@gmail.com', 30000, 'Sarah', 'Harry Potter and the Cursed Child', 2147483647, 'Janson Lane,NY', 'Harry Potter and the Cursed Child is a 2016 British two-part play written by Jack Thorne based on an original story by J. K. Rowling, John Tiffany, and Thorne.[1] Previews of the play began at the Palace Theatre, London, on 7 June 2016,[2] and it premiered on 30 July 2016. The play opened on Broadway on 21 April 2018 at the Lyric Theatre, with previews starting on 16 March 2018. Its cast was similar to that of the first year in the West End, with returning actors Anthony Boyle, Sam Clemmett, Noma Dumezweni, Poppy Miller, Jamie Parker, Alex Price, and Paul Thornley.\r\n\r\nThe story begins nineteen years after the events of the 2007 novel Harry Potter and the Deathly Hallows and follows Harry Potter, now Head of the Department of Magical Law Enforcement at the Ministry of Magic, and his younger son, Albus Severus Potter, who is about to attend Hogwarts School of Witchcraft and Wizardry. The play is marketed as the eighth story in the Harry Potter series.', 'Swindon Hall', 'Entertainment', '2022-09-23', 500, '12:30:00', , 'https://www.harrypottertheplay.com/', 400);
