(8, '0', '0', 'asmitapatil0102@gmail.com', 30000, 'Teressa Mate', 'Life Of Pi', 2147483647, 'Terrason Rd, CA', 'Stranded at sea with a tiger. After a sell-out premier in Sheffield, this adaptation of the hit novel comes to the West End for a highly anticipated run. Stunning life-size puppetry helps bring the story of Pi and his tiger Richard Parker to life, in a script by recent OBE awardee Lolita Chakrabarti. Join the journey of Life of Pi at Wyndhams Theatre today.', 'Swindon Hall', 'Entertainment', '2023-02-22', 50, '19:00:00', , 'https://www.londontheatre.co.uk/show/19234-life-of-pi', 500),
(9, '0', '0', 'asmitapatil0102@gmail.com', 30000, 'Laura Kent', 'My Neighbour Totoro', 2147483647, 'Payta Avenue, LA', 'Sometimes, the natural world is actual magic. This highly anticipated new play brings the beloved Hayao Miyazaki film to life. This adaptation brings together the talents of the films original composer Joe Hisaishi and puppetry legend Basil Twist. Take the journey and see My Neighbour Totoro at the Barbican Centre today.', 'Swindon Hall', 'Entertainment', '2023-03-16', 50, '22:45:00', , 'https://www.londontheatre.co.uk/show/25389-my-neighbour-totoro', 100);
