(10, '0', '0', 'asmitapatil0102@gmail.com', 30000, 'Martha', 'Blues for an Alabama Sky', 2147483647, 'Retma Lane', 'In 1920s New York, the Harlem Renaissance changed the lives of African American artists, creatives, and writers. Taking place during the Roaring Twenties era, the New Negro Movement made room for greater social, cultural and political discussion and ways of thinking. But as the Wall Street Crash triggered the Great Depression, the Harlem Renaissance felt the bite of a everchanging world.\r\n\r\nBlues for an Alabama Sky explores the fallout in 1930s New York through the eyes of four friends. They try to keep their artistic dreams alive, but when one of them, Angel, falls for an Alabama stranger, can the quartet stay together? Or will the realities of 1930s living take its toll?', 'Swindon Hall', 'Entertainment', '2023-07-22', 45, '18:00:00', , 'https://www.londontheatre.co.uk/show/24904-blues-for-an-alabama-sky', 250);
INSERT INTO `orders` (`id`, `order_id`, `payment_id`, `email`, `price`, `person`, `event`, `contact`, `address`, `request`, `hall`, `type`, `date`, `capacity`, `time`, `images`, `link`, `ticketcost`) VALUES
(11, '0', '0', 'asmitapatil0102@gmail.com', 30000, 'Sarah', 'Fences', 2147483647, 'Adress', 'Fences is a 1985 play by American playwright August Wilson. Set in the 1950s, it is the sixth in Wilson ten-part Pittsburgh Cycle. Like all of the Pittsburgh plays, Fences explores the evolving African-American experience and examines race relations, among other themes. The play won the 1987 Pulitzer Prize for Drama and the 1987 Tony Award for Best Play. Fences was first developed at the Eugene ONeill Theater Centers 1983 National Playwrights Conference and premiered at the Yale Repertory Theatre in 1985.', 'Swindon Hall', 'Entertainment', '2023-11-30', 75, '14:00:00', , 'https://en.wikipedia.org/wiki/Fences', 150);
